inline double GetHitBDTProb(const double x[9], const double LearingRate = 0.2, const int n_estim = 8)
{
    double prob = 0.;
    for (int iestim = 0; iestim < n_estim; iestim++)
    {
        prob += LearingRate * GetHitBDTValue(x, iestim);
    }
    
    return 1. / ( 1. + exp( - prob ) );
}
